import React from 'react';
import up from '../assets/1.png';
import down from '../assets/2.png';
import right from '../assets/3.png';
import left from '../assets/4.png';

const ParkCell = ({row, col, dir}) => {
  let cell = <div />
  if(dir == 1){
    cell = <img src={up} alt='up'/>
  } else if(dir == 2){
    cell = <img src={down} alt='down'/>
  } else if(dir == 3){
    cell = <img src={right} alt='right'/>
  } else if(dir == 4){
    cell = <img src={left} alt='left'/>
  }
  return (<div className='box' style={{backgroundColor: 'green'}}> {cell} *** PARKED *** row={row} col={col} dir={dir} </div>);
}
export default ParkCell;
